/*Generic*/

 .tc-control-panel textarea, .tc-control-panel input[type="text"], .tc-control-panel input[type="search"], .tc-control-panel input[type=""], .tc-control-panel input:not([type]), .tc-edit-field-value input[type="text"], .tc-type-selector input[type="text"] { border: 1px solid #c4c4c4; }

input[type="search"]  { border: 1px solid #e1e1e1; }
input[type="search"]:focus  { border: 1px solid #c4c4c4; }

html { scroll-behavior: smooth; }

.tc-titlebar { font-size: 2.2em; }

.tc-block-dropdown { border-radius: 4px; }

.tc-block-dropdown a:hover { background-color: #f0e68c; }

.tc-drop-down { color: #606060; font-family: gotham,helvetica,arial,sans-serif; font-size: 13px; font-weight: 500; position: relative; right: 70%; padding: 15px 7px; border-radius: 2px; border: 3px solid rgba(217,217,217,.4); border-top: 1px solid rgba(217,217,217,.4); border-left: 1px solid rgba(217,217,217,.4); margin: 1rem; margin-top: 4px; min-width:calc(100% + 100px); width: -moz-fit-content; overflow:visible; text-overflow:ellipsis; box-shadow: 0 6px 20px rgba(0,0,0,.04),-6px 8px 15px rgba(0,0,0,.04),6px 8px 15px rgba(0,0,0,.04); }

.tc-titlebar .tc-drop-down{ min-width:calc(100% + 30px); }

.tc-drop-down a:hover, .tc-drop-down button:hover, .tc-drop-down .tc-file-input-wrapper:hover button { color: #444; background-color: #f0e68c; text-decoration: none; }

.tc-password-wrapper { text-shadow: 0 1px 0 rgba(255, 255, 255, 0.5) !important; background-color: #fbfcFe !important; border: 1px solid rgb(225, 225, 225) !important; box-shadow: 0 6px 20px rgba(0,0,0,.04),-6px 8px 15px rgba(0,0,0,.04),6px 8px 15px rgba(0,0,0,.04) !important; height: 300px !important; width: 300px !important; }

.tc-password-wrapper input { width: 100% !important; color: #000 !important; border: 1px solid rgb(225, 225, 225); padding: 5px; margin-bottom:5px; } .tc-password-wrapper button { width: 100%; border-radius: 5px; text-decoration: none; color: #fff; background-color: #26a69a; text-align: center; letter-spacing: .5px; transition: .2s ease-out; cursor: pointer; border: none; padding: 5px; margin-bottom: 5px; } .tc-password-wrapper h1{ color: #666; font-size: 13px !important; text-transform: uppercase; text-align: center; }

hr { color:#ececec; }

.tg td { font-size: 13.5px; overflow: hidden; padding: .3em; word-break: normal; border-width: 0; } tr:nth-child(even) { width: 100%; background-color: #f6f3f6; } 

/* TIDDLER TOOLBAR */

.tc-tiddler-view-frame .tc-tiddler-controls svg { fill:transparent; }

.tc-tiddler-view-frame .tc-tiddler-controls:hover svg, .tc-tiddler-view-frame .tc-tiddler-controls [aria-label~=close] svg, .tc-tiddler-view-frame .tc-tiddler-controls .tc-popup svg { fill:#cccccc; }

/* BUTTON ANIMATION */

.tc-page-controls svg, .tc-tiddler-controls svg, .tc-topbar button svg, .tc-sidebar-scrollable {
  -webkit-transition: fill 200ms ease-in-out;
     -moz-transition: fill 200ms ease-in-out;
          transition: fill 200ms ease-in-out;
}

/** * Notification */

.tc-notification { position: fixed; top: 35px; right: 50px; z-index: 1300; width: 300px; height: 50px; background-color: #FABF67; border: none; color: black; text-align: center; } .hidetitle .tc-title { display:none; }

/*

---
System*/

body {
    font-family: 'Droid Sans', sans-serif;
}
.tc-body {
    background-color: #f6f6f6;
}
.tc-story-river {
    padding: 85px 42px 42px 42px;
}
@media (max-width: 768px) {
    .tc-story-river {
        padding: 60px 0px 30px 0px;
    }
}
.tc-tiddler-frame {
    width: 95%;
    margin-left: 4em;
    max-width: 1150px;
    background: #fff;
    box-shadow: 0px 0px 20px 0px #ccc;
    border: 1px solid #a7d7f9;
    border-right-width: 0;
    color: #252525;
    border-radius: 4px;
}
@media (max-width: 768px) {
    .tc-tiddler-frame {
        margin-left: 0;
        width: 100%;
        padding: 28px 20px 42px 30px;
    }
}
.tc-titlebar h2 {
    font-size: 64px;
    line-height: 1.3;
    margin-bottom: 0.25em;
    padding: 10px 0 0 0;
    font-family: serif;
    color: #AAA;
    background-color: transparent;
    border: none;
    text-align: center;
}
@media (max-width: 768px) {
    .tc-titlebar h2 {
        font-size: 32px;
        margin-top: 20px;
    }
}
.tc-titlebar {
    border-bottom: 1px solid #ccc;
}
.tc-body p {
    margin: 19px 0 !important;
    line-height: 1.5 !important;
    color: #252525;
    font-family: 'Droid Sans', sans-serif !important;
    font-size: 14px;
}
.tc-sidebar-scrollable {
    position: fixed;
    top: 0px;
    left: 0;
    bottom: 0;
    overflow-y: auto;
    overflow-x: auto;
    -webkit-overflow-scrolling: touch;
    margin: 0;
    padding: 71px 0 28px 42px;
    width: 35% !important;
}
@media (max-width: 768px) {
    .tc-sidebar-scrollable {
        width: 100% !important;
        left: 0 !important;
    }
}

@media (max-width: 768px) {
   .tc-editor-toolbar, .tc-edit-tags .tc-block-dropdown-wrapper{
display:none;
}
}
/*

---
Topbar*/

.topbar {
    top: 0;
    right: 0;
    width: 100%;
    background-color: white !important;
    box-shadow: 0px 0px 20px 0px #ccc;
    z-index: 1000;
    position: absolute;
height: 37px;
}
.logo img {
    margin-top: 0.3em;
    margin-left: 0.3em;
}
/*

---
/*Topbar Search */

.nuunsearch {
    margin-left: 40px;
    margin-top: 0px !important;
    top: 7px;
    position: absolute;
}
form {
    border: none;
}
input[type=search].simplesearch {
    border: 1px solid #c4c4c4;
    width: 15em;
    height: 1.6em
}
/*

---
/*Top Nav Box */

.topnavbox {
    right: 20px;
    top: 7px;
    position: absolute;
    color: #707070;
}
.topnavbox button {
    margin-left: 0.75em;
    font-size: 0.9em;
}
@media (max-width: 768px) {
    .topnavbox {
        display: none;
    }
}
