/*

---
/* Sidebar Tabs */


.tc-sidebar-lists button {
    color: #f03838;
    fill: #f03838;
}
.tc-sidebar-lists .tc-tab-buttons button {
    display: inline-block;
    font-size: 14px;
    font-weight: 700;
    margin: 0 10px;
    text-transform: uppercase;
    color: #f03838;
    text-decoration: none;
    padding-right: 15px;
    font-family: "Open Sans", arial, sans-serif;
    line-height: 1.8;
    text-align: center;
    padding: 0;
    background: none;
    border: none;
}
.tc-sidebar-lists .tc-tab-buttons button.tc-tab-selected {
    background-color: transparent;
    border-left: none;
    border-top: none;
    border-right: none;
    color: #666;
}
.tc-sidebar-lists .tc-search .tc-popup-handle {
    width: 60%; height:1.6em;
}
.tc-sidebar-lists .tc-tab-set .tc-tab-content .tc-reveal button {
    border: none;
    outline: none;
    background: transparent;
    color: #666;
    fill: #666;
}
.tc-sidebar-lists .tc-tab-set .tc-tab-content .tc-reveal .tc-more-sidebar .tc-tab-set .tc-tab-buttons button.tc-tab-selected {
    color: blue;
    fill: blue;
}
.tc-sidebar-lists .tc-tab-content i.tc-muted {
    display: none;
}

/*

---
/* Select */

.select_style {
    font-family: 'helvetica neue', arial;
    font-weight: 300;

    display: inline-block;
    float: right;
    overflow: hidden;
    width: 25%;
min-width:250px;
    cursor: pointer;
    color: #525252;
    border: solid 1px #dadada;
    border-radius: 5px 4px 4px 5px/5px 5px 4px 4px;
    background: #fff;
    box-shadow: 0 0 5px rgba(123, 123, 123, .2);
left: 50px;
position: absolute;
top: 7px;
}

.hideselect {
width:105%;
background:transparent;
border:none;
}

